import Board from './component/board';
import "./App.css";
import { useEffect } from 'react';

function App() {
  const sendMessage=()=>{
    socket.emit("send_message", {message:"hello"});
  };
  useEffect(()=>{
    socket.on("receive_message",(data)=>{
        alert(data.message);
    });
  },[socket]);
  return (
    <div className='App'>
      <input placeholder='message'/>
      <button onClick={sendMessage}>send message</button>
      <Board/>
    </div>
  );
}

export default App;
